@import "../variables.scss";
@import "../mixin.scss";
@import "../fonts.scss";

.products__wrapper {
  @include flex-center;
  flex-direction: column;

  .products__title {
    @include poppins-font-normal-xxl;
    color: $white;
    padding: 25px 30px;

    @media (max-width: 500px) {
      @include poppins-font-normal-xl;
      padding: 15px 10px;
    }
  }

  .products__list {
    @include flex-flex-start-center;
    flex-wrap: wrap;

    .product-item {
      width: 25%;

      @media (max-width: 1170px) {
        width: 33%;
      }

      @media (max-width: 768px) {
        width: 50%;
      }
      @media (max-width: 500px) {
        width: 100%;
      }

      .product-card {
        padding: 0 10px;
        position: relative;

        &__image {
          img {
            width: 100%;
            height: 100%;
            border-radius: 15px;
            z-index: 1;
            display: block;
            object-fit: cover;

            &:hover {
              opacity: 0.5;
            }
          }
        }

        &__preview {
          position: absolute;
          left: 0;
          top: 0;
          width: 100%;
          height: 100%;
          z-index: 2;
          opacity: 0;
          transition: 0.3s;


          &_button {
            @include poppins-font-bold-l;
            border-radius: 10px;
            border: none;
            padding: 10px 3px;
            position: absolute;
            width: 80%;
            top: 45%;
            left: 50%;
            transform: translate(-50%, -50%);
            z-index: 3;
            opacity: 1;
            background: $mainColor;
            color: $white;

            @media (max-width: 867px) {
              @include poppins-font-bold-m;
            }

            @media (max-width: 500px) {
              @include poppins-font-bold-s;
            }
          }

          &:hover {
            opacity: 1;
          }
        }

        &__discount {
          @include poppins-font-bold-m;
          text-align: center;
          color: $pink;
          max-width: 80%;
          position: absolute;
          bottom: 10px;
          left: 20px;
          z-index: 3;
          padding: 0 5px;
          border-radius: 20px;
          background-color: $palePink;

          @media (max-width: 500px) {
            padding: 5px 0;
            width: 13%;
          }
        }

        &__button {
          width: 70%;
          padding: 0 15px;
          position: absolute;
          z-index: 3;
          bottom: 7px;
          right: 3px;

          @media (max-width: 500px) {
            width: 50%;
          }

